// ExampleComponent.js

import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { addData, deleteData, updateData } from '../Redux/actions';

const Test = () => {
  const dispatch = useDispatch();
  const academicForms = useSelector(state => state.academicForms);

  const handleAddForm = () => {
    const newForm = { id: Date.now(), /* other form properties */ };
    dispatch(addData('academicForms', newForm));
  };

  const handleDeleteForm = (formId) => {
    dispatch(deleteData('academicForms', formId));
  };

  const handleUpdateForm = (updatedForm) => {
    dispatch(updateData('academicForms', updatedForm));
  };

  return (
    <div>
      {/* Your component rendering logic here */}
    </div>
  );
};

export default Test;
